                <img src={el.imgSrc} alt="person" />
                <div className="team__img-links">
              </div>
              <div className="team__title">
                <h3 className="team__title-title">
                  {el.name}
                </h3>
              </div>
            </div>
            </div>) */}
        </div>
      </div>
    </section>
  );
};

export default TeamArea;
